import React from "react";
import {
  ButtonBack,
  ButtonFirst,
  ButtonLast,
  ButtonNext,
  CarouselProvider,
  Slide,
  Slider,
  ImageWithZoom,
  DotGroup,
} from "pure-react-carousel";
import "pure-react-carousel/dist/react-carousel.es.css";

const SlickCard = () => {
  return (
    <CarouselProvider
      visibleSlides={1}
      totalSlides={8}
      step={1}
      naturalSlideWidth={200}
      naturalSlideHeight={300}
    ></CarouselProvider>
  );
};

export default SlickCard;
